import Vue from 'vue'
import Vuex from 'vuex'
//需要使用插件

Vue.use(Vuex)
//引入小仓库
import home from './home/index.js'
import search from './search/index.js'
//对外暴露Store类的一个实例
export default new Vuex.Store({
  modules: [home, search],
})
